INSERT INTO `sessions` VALUES (1,10,5,2,18,'KEY001','Keynote','Change the World','Intermediate','Keynote'),(2,3,2,3,11,'JVS307','SPA JumpStart','Build end-to-end SPA solutions including code structure and modularity, using data binding and MVVM, abstracted remote data calls, page navigation and routing, rich data features, and responsive design for mobility. Along the way I\'ll also touch on popular libraries such as Knockout, Sammy, and Breeze. ','Beginner','JavaScript|Knockout|MVVM|HTML5|Web'),(3,4,2,3,12,'JVS300','Knockout and MVVM','Do you write a lot of HTML and JavaScript code to push and pull data? In this sessions, learn popular techniques to use data binding to bind your data to your target controls in HTML writing less code, but gaining more power. See how to consume json data, use json objects in JavaScript, use declarative binding, using KnockoutJS. Also, see how to use the MVVM pattern to write data centric JavaScript code that follows good separation patterns and creates highly maintainable code.','Beginner','JavaScript|Knockout|MVVM|HTML5|Web'),(4,10,4,4,18,'ASP162','MVC 4 in Perspective','MVC 4 enables a wider variety of web applications than ever before. The libraries that are easily managed through Nuget and are truly opens source. Learn about the new capabilities and how you can contribute to ASP.NET MVC\'s evolution.','Intermediate','ASP|MVC|Web'),(5,24,6,6,32,'DAT192','Entity Framework Code First','Discover how Entity Framework Code First can improve your life!','Beginner','Data|Entity Framework|ORM'),(6,5,4,7,13,'ASP310','Building ASP.NET MVC Apps with EF Code First, HTML5, and jQuery','This sessions provides an end-to-end look at building a Web application using several different technologies.','Advanced','MVC|HTML5|Entity Framework|jQuery|Web'),(7,3,2,8,11,'JVS277','Build a Custom Single Page Application','Build a SPA, then hang out in one.','Advanced','Knockout|JavaScript|Web'),(8,4,2,11,12,'JVS201','JsRender Fundamentals','Learn how to build fast, robust, and maintainable Web applications with JavaScript, jQuery and JsRender: the successor to jQuery Templates.','Intermediate','JavaScript|JsRender|Web'),(9,3,2,12,11,'JVS201','TypeScript Fundamentals','Learn the key concepts and features that you need to know to get started with TypeScript, and use it to build large (and small) scale JavaScript applications.','Intermediate','JavaScript|JsRender|Web|TypeScript'),(10,15,8,13,23,'CLD163','Azure: to the Cloud','Windows Azure offers reliable, affordable cloud computing for almost any application of any scale, built with any technology. Scott demonstates with examples of both Windows and non-Windows applications.','Intermediate','Cloud|Azure|Node|Web'),(11,16,5,3,24,'NET282','Do More, Write Less with Web Essentials','Scale tall buildings, defeat fire breathing dragons, and be more productive in Visual Studio!','Intermediate','Web Forms|ASP|Web|.NET|'),(12,22,2,3,13,'JVS233','Durandal','Build a HTML5/JavaScript SPA with Durandal','Intermediate','JavaScript|Web|HTML5'),(13,6,10,16,14,'DSN320','Dressing for Success','You must have style to design with style. A proper wardrobe is an essential first step to application success. Learn to dress from this old pro.','Advanced','Design|Animation|Metro'),(14,6,2,3,14,'JVS121','Rich Data for JavaScript Apps is a Breeze','Do you wanna query like LINQ, make promises async, and write JavaScript code in your sleep? CatchLearn how to do that and make bring rich data features to your web apps.','Beginner','Data|JavaScript|Web'),(15,6,2,17,14,'JVS222','A JavaScript Toolbox','You need a good set of tools to be a rock star JavaScript developer. What does Ward use to write, test and debug? Come to this sessions and find out.','Intermediate','JavaScript|Web'),(16,17,4,4,25,'ASP333','ASP.NET MVC 4 Loves HTML5','TBD','Advanced','MVC|HTML5|Entity Framework|jQuery|Web'),(17,31,1,6,14,'WIN102','Introduction to Building Windows 8 Metro Applications','This sessions covers everything you n